  true,\n\t\"url\": null,\n\t\"notes\": \"Titles within the NTIS Collection represent
  billions of dollars in research. This data from NTIS contains metadata corresponding
  to items added to the NTIS Collection over the past five years. rnMetadata content
  corresponds to research reports, computer products, software, video cassettes, audio
  cassettes and more. Data includes such fields as Title, Author, Source Agency, Document
  Type, Page Count, Category Code, as well as a link to NTIS online ordering system
  for those who wish to purchase the title directly from NTIS. Users can also access
  the NTIS Website at www.ntis.gov to search, identify and purchase items within the
  NTIS Collection of more than 3,000,000 products.\",\n\t\"license_title\": \"U.S.
